        this.fetchProduct();
        console.log("End of constructor ",this.state.machinePartyList);
      }

      componentDidMount(){
        console.log("End of cdm ",this.state.machinePartyList);
      }


    render(){
      return(
        <div>
          { this.state.machinePartyList.map( (party) => (
            <p>{party.name}</p>
          )) }
        </div>  
      );
    };
}

export default PartyPins;
